import Weather from "./components/weather.jsx";
import React from "react";
import "./app.scss";

function App() {
  return (
    <div className="form__group field">
      <h1>Weather App</h1>
      <hr></hr>
      <Weather />
      <input type="input" class="form__field" placeholder="Name" />
      <label for="name" class="form__label">
        Name
      </label>
    </div>
  );
}

export default App;
